O que é Desinformação com alto poder de engajamento? 
    R: Nove verdades com uma mentira get. 

O que faz uma mentira get neste momento? 

1. Desmotivar os patriotas;
2. Achar que o jogo já está resolvido; 
3. Definir datas finais; 
4. Construir no subconsciente que têm pessoas decidindo sobre o povo; 
5. Que a nossa luta depende da caneta do Presidente;
6. Que a democracia é o povo defender um lado político (direita x esquerda), ao invés de defender o seu próprio lado e a pátria; 
7. Que jornalista tal revelou uma verdade bombástica. Jornalistas nunca revelam verdades; eles revelam o jogo de quem paga mais. Não existem generais traidores. 
8. Coleta de assinaturas e petições como possíveis soluções.  Isso nunca deu em nada. 
9. Grupos que vão te ajudar a sofrer menos no Apocalipse porque divulgarão informações vitais (reduto on line de conservadores - na Alemanha formaram os guetos para ajuntar todos). Nunca divulgue os teus dados para grupos/sites de "conservadores".  
10. Defender pessoas, políticos ou partidos vai ajudar você vencer em grupo. A antiga expressão "união faz a força"... não é bem verdade. União faz açúcar. Se você se unir com o inimigo, você neutraliza a tua força. Não lute por pessoas, políticos ou partidos. Lute pelo ppvo e pelo Brasil. 
11. Que nós estamos limitados à constituição, e não à nossa legitimidade de poder constituinte.
